.eqv FRAME_BASE 0x10008000
.eqv MAX_ADDRESS 0x1004049C
.eqv FRAME_HEIGHT 512
.eqv FRAME_WIDTH 512

.eqv win_color 0x003030b3
.eqv CLIFF_COLOR 0x008b614a
.eqv border_blue 0x0095d9e9
.eqv first_heart_address 61632
.eqv second_heart_address 61664
.eqv third_heart_address 61696

.eqv RED 0x00ee1420
.eqv BLACK 0x00000001
.eqv BACKGROUND_BLUE 0x0096d9e9
.eqv GRAVITY 1
.eqv VELOCITY 5
.eqv JUMP_VELOCITY 30

.eqv INIT_CRAB_POS 59396 #change later
.eqv INIT_ANT1_POS 11544
.eqv INIT_ANT2_POS 23848
#.eqv MIN_ANT1_POS 


.text
main: 
	li $s7, 0 #load levels, if s7 = 0 -- level 1, if s7 == 1 -- level 2, if s7 >= 2 --  level 3
start_game:
	li $s1, 0 ## if s1 is 0, game loop, if s1 is 1, win_lose_loop
	li $t1, FRAME_BASE # $t9 stores graph top left corner address
	addi $t9, $t1, INIT_CRAB_POS # init. crab positions
	li $s0, 2		#jump credit 
	li $s2, 3 # heart credits
	

	jal set_screen_BACKGROUND
	li $t8, FRAME_BASE # $t9 stores graph top left corner address
	li $s3, INIT_ANT1_POS ##s3 stores ant_fast position
	li $s6, INIT_ANT2_POS ## s6 stores slow ant position
	li $s4, 1## s4 stores current moving non-player direction (-1 r move left/up, 1 for move right/down)
	li $s5, 8 #current non-player position
	add $s3, $s3, $t8
	add $t7, $s3, $zero
	jal loadAntColours
	add $s6, $s6, $t8
	add $t7, $s6, $zero 
	jal loadAntColours
	li $t7, first_heart_address
	add $t7, $t7, $t8
	jal loadHeartColors
	li $t7, second_heart_address
	add $t7, $t7, $t8
	jal loadHeartColors
	li $t7, third_heart_address
	add $t7,$t7, $t8
	jal loadHeartColors
	#j END
	j GAME_LOOP


set_screen_BACKGROUND:
	beq $s7, 0, load_level1
	beq $s7, 1, load_level2
	bge $s7, 2, load_level3
load_level1:
	la $t3, background1
	j end_load_background
load_level2:
	la $t3, background2
	j end_load_background
load_level3:
	la $t3, background3
	j end_load_background
end_load_background:

	li $t0, FRAME_BASE
	addi $t2, $t0, 65536 #max address
	j setPixel_SCREEN


setPixel_SCREEN: ## arguments $t3 -- array to be printed, $t0 -- initial start address, $t2 -- max address
	#li $v0, 32
	#li $a0, 2 #MAINTAIN STABLER FRAME RATE
	#syscall
	lw $t1, 0($t3)
    	sw $t1, 0($t0) 
   	addi $t0, $t0, 4# increment background address
    	addi $t3, $t3, 4#increment array to next index
    	ble $t0, $t2, setPixel_SCREEN #$t2 is adress of bottom right corn of the image
    	
    	jr $ra 

############ CHECK COLLISIONS######################	 #gravity and damage
### CHECK BOTTOM COLLISION
CHECK_BOTTOM_COLLISIONS:
	addi $t7, $t9, 4096 # load in the pixel underneath the bottom left coroner
	li $t1, BACKGROUND_BLUE
	li $t2, 0 # collision pixel count
	jal check_bottom_collision_loop # if returns here, no collision
	jal DO_GRAVITY
	j AFTER_BOTTOM_col
	
check_bottom_collision_loop:
	lw $t0, 0($t7)
	addi $t2, $t2, 1 #increment counter
	addi $t7, $t7, 4 #go to next right pixel
	bne $t0, $t1, yes_bottom_collisions # if the bottom is not the background color, there is a collision
	ble $t2, 13, check_bottom_collision_loop # loop
	jr $ra #exit loop
	
yes_bottom_collisions:
	#reset jump debt since its on a platform
	li $s0, 2
	## last colored pixel is in $t0
	li $t3, win_color
	beq $t3, $t0, WIN #exit game loop, enter WIN_LOSE_LOOP
	li $t3, CLIFF_COLOR
	beq $t3, $t0, AFTER_BOTTOM_col  
	j if_damage ##JUMP TO TAKE_DAMAGE
	
DO_GRAVITY:
	li $t0, GRAVITY
	li $t1, FRAME_WIDTH
	mult $t0, $t1
	mflo $t1
	add $t8, $t9, $zero #save last position
	add $t9, $t9,$t1 #lower crab
	#jr $ra
	j eraseCrab #draw crab jumps back to game loop


if_damage:
	jal eraseCrab
	jal loadCrabColours
	li $t2, FRAME_BASE
	beq $s2, 3, eraseHeart3
	beq $s2, 2, eraseHeart2
	beq $s2, 1, eraseHeart1
	
eraseHeart3:

	li $t7, third_heart_address
	add $t7,$t2, $t7
	jal eraseHeart
	j end_eraseHeart
eraseHeart2:
	#j END #terminate test right
	li $t7, second_heart_address
	add $t7,$t2, $t7
	jal eraseHeart
	j end_eraseHeart
eraseHeart1:
	## NO hearts left
	li $t7, first_heart_address
	add $t7,$t2, $t7
	jal eraseHeart
	j LOSE #exit GAME_LOOP, go to WIN_LOSE_LOOP

end_eraseHeart:
	addi $s2, $s2, -1 #remove life
	
	sub $t6, $t9, $t8
	add $t8, $t9, $zero
	jal eraseCrab
	ble $t6, -4, go_a_little_right
	ble $t6, 12, go_a_little_left
	j end_damage_movement
go_a_little_right: 
	addi, $t9, $t9, 4
	j end_damage_movement
go_a_little_left:
	addi, $t9, $t9, -4
end_damage_movement:
	##move crab up  a little
	addi, $t9, $t9, -2048
	jal loadCrabColours
	### sleep frame rate
	li $v0, 32
	li $a0, 1000#sleep for a second when taking damage to give player time to react
	syscall
	
	j GAME_LOOP
	
######### CHECK KEY_PRESSED #######################
CHECK_KEY_PRESSED:
	li $t1, 0xFFFF0000  
	lw $t2, 0($t1) 
	bne $t2, 1, end_if_keypressed
	lw $t0, 4($t1) 
	beq $t0, 114, start_game #restart
	beq $t0, 113, END #quit
	beq $s1, 1, end_if_keypressed
	
CHECK_WAD:
	li $t3, 0 ### velocity counter
	li $t4, VELOCITY

	add $t8, $t9, $zero #save last address
	beq $t0, 100, if_d_pressed
	beq $t0, 97, if_a_pressed
	
	### CHECK_BOTTOM_COLLISIONS, if it returns here do the jump
	li $t4, JUMP_VELOCITY
	beq $t0, 119, if_w_pressed
	j end_if_keypressed
if_d_pressed:
	li $t5, -4 ## RIGHT DIRECTION, move hitbox left
	bgt $t3, $t4, end_if_keypressed
	addi $t3, $t3, 1 ##increment steps done
	li $t2, 0 #reset collision counter
	addi $t7, $t9, 56 #save current address
	li $t1, BACKGROUND_BLUE
	
	jal CHECK_LR_COLLISION
	j DO_MOVE_RIGHT

if_a_pressed:
	li $t5, 4 ## LEFT DIRECTION, move hitbox right
	bgt $t3, $t4, end_if_keypressed
	addi $t3, $t3, 1 ##increment steps done
	li $t2, 0
	addi $t7, $t9, -4#save rightmost pixel+1 as init. address
	li $t1, BACKGROUND_BLUE
	
	jal CHECK_LR_COLLISION
	j DO_MOVE_LEFT

if_w_pressed:
	ble $s0, 0, end_if_keypressed # branch if no jump credits
	bge $t3, $t4, end_if_w_pressed # branch if reaches upper bound/finishes velocity
	addi $t3, $t3, 1 ##increment steps done
	li $t2, 0 # reset collision counter
	addi $t7, $t9, -512 #save pixel above top left corner as init. address
	li $t1, BACKGROUND_BLUE
	jal CHECK_UPPER_COLLISION
	j DO_JUMP
DO_JUMP:
	addi, $t9, $t9, -512 #move up
	j if_w_pressed	

CHECK_UPPER_COLLISION:
	
	lw $t0, 0($t7) #next upper pixel
	bne $t0, $t1, end_if_w_pressed
	addi $t7, $t7, 4 #go to next pixel in row
	addi $t2, $t2, 1 # increment collision counter
	ble $t2, 13, CHECK_UPPER_COLLISION #KEEP LOOPING
	jr $ra #exit if no collisions
	

end_if_w_pressed:
	#update jump debt
	addi $s0, $s0, -1
end_if_keypressed:
	beq $s1, 0, CHANGE
	beq $s1, 1, WIN_LOSE_LOOP
	

DO_MOVE_RIGHT:
	addi $t9, $t9, 4 #move right
	j if_d_pressed
DO_MOVE_LEFT:
	addi $t9, $t9, -4 #move left
	j if_a_pressed
	
#check_right_collision ($t8 --curr_address, $t1 --other color, $t2 -- counter)
CHECK_LR_COLLISION: #$t8 has a temporary address that can be modified
	
	lw $t0, 0($t7) #next left/right pixel
	bne $t0, $t1, has_LR_collision
	addi $t7, $t7, 512 #go to next row
	addi $t2, $t2, 1 #increment counter
	ble $t2, 7, CHECK_LR_COLLISION 
	jr $ra
	
	

has_LR_collision:
	
	##t0 contains last pixel (pixel that causes collisions)
	li $t3, CLIFF_COLOR
	beq $t0, $t3, GAME_LOOP
	li $t3, border_blue
	beq $t0, $t3, GAME_LOOP
	j if_damage #change to take damage
	
GAME_LOOP:

	jal loadCrabColours
	### sleep frame rate
	li $v0, 32
	li $a0, 50 #MAINTAIN STABLER FRAME RATE
	syscall
	
	jal MOVE_NONPLAYER
	addi $t7, $s3, 0
	jal loadAntColours
	addi $t7, $s6, 0
	jal loadAntColours
	j CHECK_KEY_PRESSED
CHANGE:
	jal eraseCrab
	jal loadCrabColours
	jal CHECK_BOTTOM_COLLISIONS
AFTER_BOTTOM_col:
	li $t1, BACKGROUND_BLUE
	#addi $t8, $t9, 0
	addi $t7, $t9, -4 #check left collision
	li $t2, 0
	jal CHECK_LR_COLLISION
	
	#addi $t8, $t9, 0
	addi $t7, $t9, 56 #check right collision
	li $t2, 0
	jal CHECK_LR_COLLISION
	
	j GAME_LOOP 



#### move NON-PLAYER ITEMS
MOVE_NONPLAYER:
	add $t1, $ra,  $zero # push on move non-player onto the
	addi $sp, $sp, -4 # stack
	sw $t1, 0($sp)
	beq $s5, 8, switch_directions
	beq $s5, 0, switch_directions
	j move_ant
	#jal move_platform
	
switch_directions:
	li $t1, -1
	mult $t1, $s4
	mflo $s4
move_ant:
	add $s5, $s5, $s4 # increment ant position
	li $t6, 4
	mult $t6, $s4
	mflo $t6 # move address by one pixel

